  import Reat from 'react';
  import Write from "./Write"
  import Modal from "./Modal"
  import { useNavigate } from "react-router-dom";

  const Post = () => {

    const navigate = useNavigate();

    const write = () => {
      navigate('/write')
    }
    const modal = () => {
      navigate('/modal')
    }

    return (
      <header>
      <h1>게시판</h1>
      <hr/>
